import React from 'react';
import Note from './Note';

class NoteList extends React.Component {
  render() {
    return (
      <div>
        {this.props.notes.map((note, index) => (
          <Note key={index} text={note} />
        ))}
      </div>
    );
  }
}

export default NoteList;
